import React from "react";


function GetData() {

    const [allData, setData] = React.useState(null);

    React.useEffect(() => {
      fetch("http://localhost:3001/api", {
        headers : { 
          'Content-Type': 'application/json',
          'Accept': 'application/json'
         }
      })
        .then((res) => res.json())
        .then((data) => setData(data.docs));
    }, []);

    return allData;

}

export default GetData;
